sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var res=(inputs.res1);
//gs.info("res"+JSON.stringify(res));
array=res.getresp;
//gs.info("Array"+array);
//gs.info("res"+JSON.stringify(array));
var clientID=[]
array.forEach(function(doc){
    if(doc.rqmntcd=="REQ_5034" || doc.rqmntcd=="REQ_5035" || doc.rqmntcd=="REQ_004"){
        var obj={
            rqmntcd:doc.rqmntcd,
            client_id:doc.clntid,
            requestkey:doc.rqmnttrnskey
        }
        clientID.push(obj);
    }
})
//JSON.stringify()
outputs.res=(clientID);
//gs.info(JSON.stringify(clientID));
})(inputs, outputs);

